@-webkit-keyframes clonePulse {
  0%, 100% {
    opacity: .25; }
  50% {
    opacity: .75; } }

@keyframes clonePulse {
  0%, 100% {
    opacity: .25; }
  50% {
    opacity: .75; } }

.cloneIndicator {
  display: inline-block;
  margin: 7px 7px 0 0;
  font-size: 16px;
  font-weight: bold;
  text-transform: uppercase;
  color: #ff0000;
  opacity: .25;
  vertical-align: top;
  text-align: center;
  -webkit-transform: rotate(350deg);
  transform: rotate(350deg);
  -webkit-animation-name: clonePulse;
  -webkit-animation-duration: 3s;
  -webkit-animation-delay: 0s;
  -webkit-animation-iteration-count: infinite;
  -webkit-animation-timing-function: ease-in-out;
  animation-name: clonePulse;
  animation-duration: 3s;
  animation-delay: 0s;
  animation-iteration-count: infinite;
  animation-timing-function: ease-in-out; }
  .cloneIndicator.doubleLine {
    margin-top: 3px;
    font-size: 12px;
    line-height: 14px; }

.statusMessage {
  position: relative;
  max-height: 0px;
  overflow: hidden;
  -webkit-transition-duration: 0.25s;
  -moz-transition-duration: 0.25s;
  -o-transition-duration: 0.25s;
  transition-duration: 0.25s;
  -webkit-transition-property: max-height, margin;
  -moz-transition-property: max-height, margin;
  -o-transition-property: max-height, margin;
  transition-property: max-height, margin; }
  .statusMessage .message {
    text-align: center;
